import React, { Component } from 'react';
import Slider from 'react-slick';
import Image from 'react-bootstrap/Image';

import './HomeSlider.css';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

export default class HomeSlider extends Component {
	render() {
		const settings = {
			dots: false,
			infinite: true,
			autoplaySpeed: 2000,
			speed: 500,
			slidesToShow: 1,
			fade: true,
			slidesToScroll: 1,
			arrows: false,
			autoplay: true
		};
		return (
			<React.Fragment>
				<Slider {...settings}>
					<div>
						<Image className="img-slide-dimension" src="https://wallpapercave.com/wp/wp2604630.jpg" />
					</div>
					<div>
						<Image className="img-slide-dimension" src="https://wallpapercave.com/wp/wp2604630.jpg" />
					</div>
					<div>
						<Image
							className="img-slide-dimension"
							src="https://bestcoverpix.com/wp-content/uploads/2014/01/clear-water-island-Nature-Facebook-covers.jpg"
						/>
					</div>
					<div>
						<Image
							className="img-slide-dimension"
							src="http://www.trendycovers.com/covers/beautiful_beach_island_facebook_cover_1406563294.jpg"
						/>
					</div>
				</Slider>
			</React.Fragment>
		);
	}
}
